import logo from './logo.svg';
import './App.css';

import React, { useState } from "react";
import { SwatchesPicker } from "react-color";

const App = () => {
  const [color, setColor] = useState("#000000");

    return (
      <div>
        <div style={{ display: "flex", flexDirection: "column" }}>
          <SketchPicker color={color} onChange={(color) => setColor(color.hex)} />
        </div>
        <svg viewBox="0 0 128 128" width="128" height="128">
          <rect x="0" y="0" width="128" height="128" fill={color} />
          <rect x="32" y="32" width="64" height="64" fill="#FFF" />
          <rect x="48" y="48" width="16" height="16" fill={color} />
          <rect x="48" y="80" width="16" height="16" fill={color} />
          <rect x="80" y="48" width="16" height="16" fill={color} />
          <rect x="64" y="56" width="16" height="16" fill={color} />
          <rect x="56" y="64" width="16" height="16" fill={color} />
        </svg>
      </div>
    );

};

export default App;
